import React, {useEffect,useState } from 'react'

const Test = (props) => {

  var obj = { Male: ["MHRT", "Primary care"], Female: ["FHRT", "Primary care"] };

  const [gender] = useState(obj)

  const [output, setOutput] = useState([]);

  const getvalue = () => {
    console.log('current_selected ',output)
  }

  useEffect(()=>{
    getData();
  },[])

  const getData  = async ()=>{
    let response = await fetch(`https://myvyavsay.com/merchant_detail/shope`,{
      headers:{
        "Access-Control-Allow-Origin": "myvyavsay.com",
        "Content-Type": "application/json"
      }
    });
    let data = await response.json();
    console.log('response ', data);
  }

  const changehandler = (e) => {
    var radios = document.getElementsByName('gender');
    for (var radio of radios) {
      if (radio.checked) {
        let value = radio.value;
        let gender = radio.getAttribute("data_type");
        setOutput([{ gender: gender }, { value: value }]);
      }

    }
  }

  return (
   <div className='container'>
      <ul class="nav nav-pills mb-3 mt-5 " id="pills-tab" role="tablist">
        <li class="nav-item">
          <a class="nav-link active" id="pills-home-tab" data-toggle="pill" href="#pills-home" role="tab" aria-controls="pills-home" aria-selected="true">Male</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" id="pills-profile-tab" data-toggle="pill" href="#pills-profile" role="tab" aria-controls="pills-profile" aria-selected="false">Female</a>
        </li>

      </ul>
      <div class="tab-content" id="pills-tabContent">

        <div class="tab-pane fade show active" id="pills-home" role="tabpanel" aria-labelledby="pills-home-tab">

          {gender.Male.map((value,key)=>{
            // for male
            return (
              <div key={key} className='d_flex'>
              {value} : <input type="radio" name="gender" data_type="Male" onChange={changehandler} value={value}/>
              </div>
            )
          })}

          </div>
        <div class="tab-pane fade" id="pills-profile" role="tabpanel" aria-labelledby="pills-profile-tab">
        {gender.Female.map((value,key)=>{
          // for Female
            return (
              <div key={key} className='d_flex'>
              {value} : <input type="radio" name="gender" data_type="Female" onChange={changehandler} value={value}/>
              </div>
            )
          })}

        </div>

      </div>
      <button className='btn btn-info mt-2' onClick={getvalue}>Get value</button>
   </div>
  )
}

export default Test
